import React from 'react';
import './App.css';
import { Switch, Route } from 'react-router-dom';

import Navbar from './components/navbar';
// import Home from './Home';
// import Game from './Game';
import Login from './signIn';
import Register from './Register';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Switch>
        <Route path="/" exact>
          <Login />
          <Register />
        </Route>

        <Route path="/game">
          <div>Game</div>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
